  false,\n\t\"url\": null,\n\t\"notes\": \"This monthly narrative report for Great
  Meadows National Wildlife Refuge Complex outlines Refuge accomplishments during
  January 1998. The report begins with a summary of the month's weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management plans, public participation, compliance with environmental mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, funding, and safety is given.  The habitat management section covers
  forest management. The wildlife section of the report discusses endangered and/or
  threatened species, animal control, and marking/banding. The public uses of the
  Refuge described in this report include outdoor classrooms, interpretive programs,
  wildlife observation, outdoor recreation, and law enforcement. The equipment and
  facilities section of the report provides information about rehabilitation, major
  maintenance, and communication systems. Cooperative programs are provided at the
  end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
